import com.google.common.collect.LinkedHashMultimap;
import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class Main {
    public static void main(String[] args) {
        // Initialize a LinkedHashMultimap and perform some operations
        LinkedHashMultimap<String, String> multimap = LinkedHashMultimap.create();
        LinkedHashMultimap<String, String> multimap2 = LinkedHashMultimap.create();

        // Initialize a HashMap for additional operations
        Map<String, Integer> hashMap = new HashMap<>();
        hashMap.put("key1", 10);
        hashMap.put("key2", 20);

        // Initialize a HashSet for additional operations
        Set<String> hashSet = new HashSet<>();
        hashSet.add("setElement1");
        hashSet.add("setElement2");

        // Perform operations on the second multimap
        multimap2.put("key2", "value2");
        multimap2.put("key3", "value3");

        /* write */ multimap.put("key1", "value1");

        // Perform operations on the HashMap
        for (Map.Entry<String, Integer> entry : hashMap.entrySet()) {
            System.out.println("HashMap Key: " + entry.getKey() + ", Value: " + entry.getValue());
        }

        // Perform operations on the HashSet
        for (String element : hashSet) {
            System.out.println("HashSet Element: " + element);
        }

        // Additional operations on the second multimap
        for (String key : multimap2.keySet()) {
            System.out.println("Multimap2 Key: " + key + ", Values: " + multimap2.get(key));
        }

        // Retrieve the value from the original multimap
        /* read */ String value = multimap.get("key1").iterator().next();

        // Print the retrieved value
        System.out.println("Retrieved Value: " + value);
    }
}
